public class InnerLaunchProfileStreamConfigurationFactory(Action<Humidifier.NimbleStudio.LaunchProfileTypes.StreamConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.NimbleStudio.LaunchProfileTypes.StreamConfiguration>
{

    internal InnerLaunchProfileStreamConfigurationSessionBackupFactory SessionBackupFactory { get; set; }

    internal InnerLaunchProfileStreamConfigurationSessionStorageFactory SessionStorageFactory { get; set; }

    internal InnerLaunchProfileVolumeConfigurationFactory VolumeConfigurationFactory { get; set; }

    protected override Humidifier.NimbleStudio.LaunchProfileTypes.StreamConfiguration Create()
    {
        var streamConfigurationResult = CreateStreamConfiguration();
        factoryAction?.Invoke(streamConfigurationResult);

        return streamConfigurationResult;
    }

    private Humidifier.NimbleStudio.LaunchProfileTypes.StreamConfiguration CreateStreamConfiguration()
    {
        var streamConfigurationResult = new Humidifier.NimbleStudio.LaunchProfileTypes.StreamConfiguration();

        return streamConfigurationResult;
    }
    public override void CreateChildren(Humidifier.NimbleStudio.LaunchProfileTypes.StreamConfiguration result)
    {
        base.CreateChildren(result);

        result.SessionBackup ??= SessionBackupFactory?.Build();
        result.SessionStorage ??= SessionStorageFactory?.Build();
        result.VolumeConfiguration ??= VolumeConfigurationFactory?.Build();
    }

} // End Of Class

